int main(void)
{

  volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;
  volatile int *PS2_ptr = (int *)PS2_BASE;

  *PS2_ptr = 0xFF; // reset


  //--------------------------------------------------------------------

  /* set front pixel buffer to start of FPGA On-chip memory */
  *(pixel_ctrl_ptr + 1) = FPGA_ONCHIP_BASE; // first store the address in the
                                            // back buffer
  /* now, swap the front/back buffers, to set the front buffer location */
  wait_for_vsync();
  /* initialize a pointer to the pixel buffer, used by drawing functions */
  pixel_buffer_start = *pixel_ctrl_ptr;

  clear_screen(); // pixel_buffer_start points to the pixel buffer
  /* set back pixel buffer to start of SDRAM memory */
  *(pixel_ctrl_ptr + 1) = SDRAM_BASE;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

  //Start screen
  bool readyToStart = false;
   bool gameStart = false;
   draw_full_screen(start_screen);
   wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
   pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

   while(gameStart == false){
         int keyValue = *keyPtr;;
         if(keyValue == 2)
     {
        readyToStart = true;
     }
         else if(keyValue == 0 && readyToStart == true)
     {
             gameStart = true;
       printf("Game starting...\n");
         }
     }
   printf("Game started!\n");


clear_screen();
// count time steps to space out arrow appearances
  uint8_t count = 0;
  while (countdown > 0)
  {
    if (count % 2 == 0)
    {
      srand(time(NULL)); // seed rand using current system time for better variability
      chooseArrow();
    }
    count++;

    // draw background
    draw_full_screen(bg_map);
	// draw countdown for game
	draw_countdown(countdown_length, countdown_colour);

	// If the arrows have gone past the background outlines, reset position to top of the screen, and turn off that arrow
    if (y_coor_l >= 127)
    {
      y_coor_l = 0;
      drawLeft = false;
    }
    if (y_coor_u >= 127)
    {
      y_coor_u = 0;
      drawUp = false;
    }
    if (y_coor_d >= 127)
    {
      y_coor_d = 0;
      drawDown = false;
    }
    if (y_coor_r >= 127)
    {
      y_coor_r = 0;
      drawRight = false;
    }

    // If an arrow's boolean flag is set, draw this arrow
    if (drawLeft)
    {
      draw_left(y_coor_l);
      y_coor_l += 24;
    }
    if (drawUp)
    {
      draw_up(y_coor_u);
      y_coor_u += 24;
    }
    if (drawDown)
    {
      draw_down(y_coor_d);
      y_coor_d += 24;
    }
    if (drawRight)
    {
      draw_right(y_coor_r);
      y_coor_r += 24;
    }



	// Handle PS2 input
    int PS2_data = *(PS2_ptr);        // read the Data register in the PS/2 port
    int RVALID = (PS2_data & 0x8000); // compare to RVALID field
	if (RVALID)
    {
      /* always save the last three bytes received */
      byte1 = byte2;
      byte2 = byte3;
      byte3 = PS2_data & 0xFF; // load fresh data to b3 and shift old data to b2 -> b1

      //“& 0xff” effectively masks the variable so it leaves only the value in the last 8 bits,
      //ignores all the rest of the bits.


		if ((byte2 == (char)0xAA) && (byte3 == (char)0x00))
		{
		  *(PS2_ptr) = 0xF4;
		}

	}

      //checks for arrow keys
      if ((arrow_key(byte1, byte2, byte3) == 1))
      { //Down arrow
		  printf("down: %d\n", y_coor_d);

			score++;
			printf("score: %d\n", score);
			display_hex(score);

      }
      if ((arrow_key(byte1, byte2, byte3) == 2))
      { //Up arrow
		printf("up: %d\n", y_coor_u);

			score++;
			printf("score: %d\n", score);
			display_hex(score);

      }
      if ((arrow_key(byte1, byte2, byte3) == 3))
      { //Left arrow
		  printf("left: %d\n", y_coor_l);

			score++;
			printf("score: %d\n", score);
			display_hex(score);

      }
      if ((arrow_key(byte1, byte2, byte3) == 4))
      { //Right arrow
		  printf("right: %d\n", y_coor_r);

			score++;
			printf("score: %d\n", score);
			display_hex(score);

      }



    wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

	  //Countdown Game Timer
    if(countdown < 15)
    {
        countdown_colour = 0xFF00;
    }
    if(countdown < 5 )
    {
        countdown_colour = 0xF000;
    }
    countdown = countdown - 1;
    countdown_length = countdown_length - (countdown_length / countdown);

  }


  // game over
  draw_full_screen(end);
wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
}

//=============================================================================
// VGA-HELPERS
//=============================================================================
void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_screen() {
    for(int i = 0; i < RESOLUTION_X; i++) {
        for(int j = 0; j < RESOLUTION_Y; j++) {
            plot_pixel(i, j, 0x0000);
        }
    }
}

void swap (int *x, int *y) {
	int temp = *x;
	*x = *y;
	*y = temp;
}

void draw_line(int x0, int y0, int x1, int y1, short int color) {

    bool is_steep = ABS(y1 - y0) > ABS(x1 - x0);

    if (is_steep)  {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }

    if (x0 > x1) {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int err = -((x1 - x0) / 2);
    int y = y0;
    int y_step = -1;

    if (y0 < y1) {
        y_step = 1;
    }

    int x = x0;

    for (x = x0; x <= x1; x++) {
        if (is_steep) {
            plot_pixel(y, x, color);
        }
        else {
            plot_pixel(x, y, color);
        }

        err += ABS(y1 - y0);

        if (err >= 0) {
            y += y_step;
            err -= (x1 - x0);
        }
    }
}

void wait_for_vsync()
{
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020; // pixel controller
  register int status;

  *pixel_ctrl_ptr = 1; // start the synchronization process

  status = *(pixel_ctrl_ptr + 3);
  while ((status & 0x01) != 0)
  {
    status = *(pixel_ctrl_ptr + 3);
  }
}

