void draw_full_screen(const uint8_t bg_map[])
{

  int i = 0, j = 0;
  // Loop through full pixel buffer and fill with corresponding values from an array of EQUAL SIZE
  for (int k = 0; k < RESOLUTION_X * 2 * RESOLUTION_Y - 1; k += 2)
  {
    // Use rgb data scheme provided in (image).c files
    int red = ((bg_map[k + 1] & 0xF8) >> 3) << 11;
    int green = (((bg_map[k] & 0xE0) >> 5)) | ((bg_map[k + 1] & 0x7) << 3);
    int blue = (bg_map[k] & 0x1f);

    short int p = red | ((green << 5) | blue);
	
    plot_pixel(i, j, p);

    i++;
    if (i == 320)
    {
      i = 0;
      j++;
    }
  }
}

