void chooseArrow()
{
  //produce a random number between 0 and 3 to choose which arrow to draw
  int whichArrow = rand() % 4;
  switch (whichArrow)
  {
  case 0:
    drawLeft = true;
    break;

  case 1:
    drawUp = true;
    break;

  case 2:
    drawDown = true;
    break;

  case 3:
    drawRight = true;
    break;

  default:
    break;
  }
}

